// src/components/Header.js
import React from 'react';
import { Navbar, Nav, Image } from 'react-bootstrap';
import logoIcon from '../assets/logo.png';  
import bellIcon from '../assets/bell.png';  // Ad
import userIcon from '../assets/user.png';  // Ad
import './Header.css';

const Header = () => {
  return (
    <Navbar bg="dark" variant="dark" className="header-navbar">
      <Navbar.Brand href="/">
        <Image src={logoIcon} alt="Logo" className="header-logo" />
        Dashboard
      </Navbar.Brand>
      <Nav className="ml-auto">
        <Nav.Link href="#notifications">
          <Image src={bellIcon} alt="Notifications" className="header-icon" />
        </Nav.Link>
        <Nav.Link href="#profile">
          <Image src={userIcon} alt="Profile" className="header-icon" />
        </Nav.Link>
      </Nav>
    </Navbar>
  );
};

export default Header;
